// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract GestionNombres {
    // Dynamic array to store numbers
    uint[] private nombres;

    // Constructor initializes the array (optional: add initial values)
    constructor() {
        // Initialize with default values (optional)
        nombres = [10, 20, 30];
    }

    // Add a number to the array
    function ajouterNombre(uint _nombre) public {
        nombres.push(_nombre);
    }

    // Get element at specific index with bounds checking
    function _getElement(uint index) public view returns (uint) {
        require(index < nombres.length, "Index hors limites");
        return nombres[index];
    }

    // Return the entire array
    function afficheTableau() public view returns (uint[] memory) {
        return nombres;
    }

    // Calculate sum of all numbers in the array
    function calcularSomme() public view returns (uint) {
        uint somme = 0;
        for (uint i = 0; i < nombres.length; i++) {
            somme += nombres[i];
        }
        return somme;
    }
}
